import React from "react";

type PropsType = {
    topCars: Array<topCarsType>
}

type topCarsType = {
    manufacturer: string
    model: string
}

export const NewCars = (props:PropsType) => {
    return (
        <table>
        {props.topCars.map((el, index) => {
            return (
                    <tr>
                        <th>{el.manufacturer}</th>
                        <th>{el.model}</th>
                    </tr>
                    )
                    })}
        </table>

            );
            };
